CREATE TABLE `xs_gift` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) DEFAULT '' COMMENT '礼物名称',
  `name_zh_tw` varchar(20) DEFAULT '' COMMENT '礼物名称台湾版',
  `name_en` varchar(20) DEFAULT '' COMMENT '礼物名称英文版',
  `name_ar` varchar(128) DEFAULT '' COMMENT '礼物名称阿语版',
  `name_ms` varchar(128) DEFAULT '' COMMENT '礼物名称马来语版',
  `name_th` varchar(128) DEFAULT '' COMMENT '礼物名称泰语版',
  `name_id` varchar(128) DEFAULT '' COMMENT '礼物名称印度尼西亚',
  `name_vi` varchar(128) DEFAULT '' COMMENT '礼物名称越南语',
  `name_ko` varchar(128) DEFAULT '' COMMENT '礼物名称韩语版',
  `price` decimal(19,2) NOT NULL DEFAULT '0.00' COMMENT '单价，元',
  `name_jp` varchar(128) DEFAULT '' COMMENT '礼物名称日语版',
  `display` set('room','chat','order','mounts','decorate') NOT NULL DEFAULT 'room,chat,order' COMMENT '礼物场景，房间，私聊，订单, 坐骑, 主页装扮',
  `sub_display` set('all','wolf','guess','under','juben','union','finger_guess','theone','order','music','radio-defend','cp-woman','cp-man','joy-woman','joy-man','live','expand','cplink','concert') NOT NULL DEFAULT 'all',
  `type` enum('static','normal','fullscreen','multiframe') NOT NULL DEFAULT 'normal',
  `gift_type` enum('normal','coin','vdiamond') NOT NULL DEFAULT 'normal' COMMENT '礼物类型字段。normal 普通消费礼物, coin 金币消费礼物, vdiamond 家族钻石礼物',
  `income_type` enum('money','coin','union_gold','union_active') NOT NULL DEFAULT 'money' COMMENT '礼物赠送对方收入类型。money 伴伴币, coin 金币 union_gold 联盟金币 union_active 联盟活跃值',
  `with_end` tinyint(1) NOT NULL DEFAULT '0' COMMENT '对于normal是否有结束图',
  `size` int(11) DEFAULT '0' COMMENT '文件大小，normal和fullscreen都是zip',
  `size_big` int(11) DEFAULT '0',
  `ordering` int(11) DEFAULT '0' COMMENT '排序',
  `deleted` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否有效',
  `title` tinyint(1) NOT NULL DEFAULT '0' COMMENT '爵位等级',
  `naming` varchar(20) DEFAULT '' COMMENT '冠名',
  `xratio` varchar(6) DEFAULT '',
  `xtype` enum('small','big','multiframe','') DEFAULT '',
  `excludes` varchar(64) NOT NULL DEFAULT '' COMMENT '过滤语言列表',
  `tag_url` varchar(255) DEFAULT '' COMMENT 'static/commodity/c20042412582628.png',
  `tag_ids` varchar(50) NOT NULL DEFAULT '' COMMENT '物品标签,多个id以应文:隔开,如 1:2',
  `description` varchar(500) NOT NULL DEFAULT '' COMMENT '礼物描述',
  `jump_page` varchar(200) NOT NULL DEFAULT '' COMMENT '跳转url',
  `version` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `vap_type` enum('','normal','fullscreen') DEFAULT '' COMMENT 'VAP礼物类型,入场,全屏',
  `vap_size` int(11) DEFAULT '0' COMMENT '礼物大小',
  `vap_header` tinyint(4) DEFAULT '0' COMMENT '是否带用户头像',
  `vap_header_start` int(11) DEFAULT '0' COMMENT '头像出现帧',
  `vap_header_end` int(11) DEFAULT '0' COMMENT '头像消失帧',
  `is_combo` tinyint(1) unsigned DEFAULT '0' COMMENT '是否是连击礼物;0:不是1:是',
  `is_skin` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否是礼物皮肤',
  `gid_basic` int(11) DEFAULT NULL COMMENT '礼物皮肤关联的基本礼物',
  `num_to_unlock` smallint(4) DEFAULT NULL COMMENT '解锁礼物皮肤所需的赠送个数',
  `name_tr` varchar(128) DEFAULT '' COMMENT '礼物名称土耳其语版',
  `app_id` tinyint(4) unsigned NOT NULL DEFAULT '5' COMMENT '限定app_id',
  `is_app_public` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '是否所有app公用.0:不公用,1:公用',
  `category` varchar(20) DEFAULT '' COMMENT '礼物种类',
  `name_ja` varchar(128) DEFAULT '' COMMENT '礼物名称日语版',
  `name_pt` varchar(128) DEFAULT '' COMMENT '礼物名称葡语版',
  `name_es` varchar(128) DEFAULT '' COMMENT '礼物名称西语版',
  `price_ratio` tinyint(4) NOT NULL DEFAULT '-1' COMMENT '分成比',
  `description_tw` varchar(500) NOT NULL DEFAULT '' COMMENT '礼物描述_繁体中文',
  `description_en` varchar(500) NOT NULL DEFAULT '' COMMENT '礼物描述_英语',
  `description_th` varchar(500) NOT NULL DEFAULT '' COMMENT '礼物描述_泰语',
  `description_id` varchar(500) NOT NULL DEFAULT '' COMMENT '礼物描述_印尼',
  `description_pt` varchar(500) NOT NULL DEFAULT '' COMMENT '礼物描述_葡萄牙',
  `description_es` varchar(500) NOT NULL DEFAULT '' COMMENT '礼物描述_西班牙',
  `desc_icon` varchar(255) NOT NULL DEFAULT '' COMMENT '描述卡图片',
  `desc_redirect` varchar(128) NOT NULL DEFAULT '' COMMENT 'cta跳转',
  PRIMARY KEY (`id`),
  KEY `idx_app_id` (`app_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=11017026 DEFAULT CHARSET=utf8;
